import React, { useState, useEffect } from 'react';
import Navbar from '../components/Navbar';

function HomePage() {
    const [data, setData] = useState({});
    const [loading, setLoading] = useState(true); // Add loading state
    const [error, setError] = useState(null); // Add error state

    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await fetch('http://localhost:3000/api/auth/bookmarks/${userId}', {
                    method: 'GET',
                    headers: {
                        'Content-Type': 'application/json',
                        // Add any other headers you need, e.g., Authorization for authentication
                    },
                });

                if (response.status === 200) {
                    const result = await response.json();
                    setData(result);
                    setLoading(false); // Mark loading as complete
                } else {
                    setError('Error fetching data');
                    setLoading(false); // Mark loading as complete with error
                }
            } catch (error) {
                setError(error.message);
                setLoading(false); // Mark loading as complete with error
            }
        };

        fetchData();
    }, []);

    return (
        <div className="home-container">
            <Navbar className="navbar" />

            <div className="content-container">
                <h2>Welcome to My Website</h2>
                {loading ? (
                    <p>Loading...</p>
                ) : error ? (
                    <p>Error: {error}</p>
                ) : (
                    <div>
                        {/* Display your data here */}
                        {/* For example, if your data is an object with a 'message' property: */}
                        <p>{data.message}</p>
                    </div>
                )}
            </div>
        </div>
    );
}

export default HomePage;
